import Button from "@material-ui/core/Button";
import ButtonGroup from "@material-ui/core/ButtonGroup";

function PositionsButtonGroup( props ) {
    const [ count, setCount ] = useState(0)
    return (
        <ButtonGroup>
            <Button>+</Button>
            <Button>-</Button>
        </ButtonGroup>
    )
}

export default PositionsButtonGroup;
